using System.Runtime.Serialization.Json;
using System.Threading.Tasks;

namespace ServiceHub.User.Service
{
    public static class DbSeeder
    {
        public static async Task InitializeAsync(IServiceProvider serviceProvider)
        {
            var context = serviceProvider.GetRequiredService<IUserRepository>();
            var currentUsers = await context.GetAsync();
            if (currentUsers == null || currentUsers.Count == 0)
            {
                try
                {
                    string jsonStr = DbSeeder.GetUsers();
                    var users = DbSeeder.Deserialize<List<User.Context.Models.User>>(jsonStr);

                    foreach (var user in users)
                    {
                        await context.InsertAsync(user);
                    }
                }
                catch (Exception e)
                {
                    ILogger logger = AppLoggerFactory.CreateLogger();
                    logger.LogError(e, "Db seeding failed.");
                }
            }
        }

        // Deserialize JSON string and return object.
        public static T Deserialize<T>(string jsonStr)
        {
            T obj = default(T);
            MemoryStream ms = new MemoryStream();
            try
            {
                DataContractJsonSerializer ser =
                    new DataContractJsonSerializer(typeof(T));
                StreamWriter writer = new StreamWriter(ms);
                writer.Write(jsonStr);
                writer.Flush();
                ms.Position = 0;
                obj = (T)ser.ReadObject(ms);
            }
            catch (Exception)
            {
                throw;
            }
            finally
            {
                ms.Close();
            }
            return obj;
        }

